INSERT INTO `GraphModel_algo_template` VALUES (10,'半监督诈骗交易检测','# 半监督诈骗交易检测\r\n在模版交易分类中，我们介绍了基于Graphsage算子，融合user、item节点上丰富的特征，聚合其邻居特征，使用半监督的方法在超大规模的交易图上完成交易分类。在这个模块中，用户需要提供部分交易的标注，即给部分交易打上标签。\r\n\r\n但是一些场景中，开发者可能只能提供一个黑名单跟白名单来标识哪些用户是坏账户，哪些用户是正常用户。用户又想在不需要额外标注的情况下，对未来的数据进行预测。\r\n\r\n在这个场景下，可以考虑组合使用“标签传播算法”-“交易分类”模版，下面具体介绍一下：\r\n\r\n首先用用户提供的黑白名单进行标签传播，从而得到更多用户上的伪标签信息，然后对于一个商品，聚合其涉及交易的用户标签信息，得到商品的伪标签信息，最后设置规则，得到一笔交易的伪标签，然后选取高置信度的伪标签，训练GraphSage模型，进而对测试集的数据进行推测（比如次日的数据），得到每一笔交易的标签。然后可以取出所有的虚假交易构成的子图，然后可以利用“基于Biclique的诈骗团伙检测”方案进行诈骗团队的发现。','{\"cells\":[{\"shape\":\"GuideEdge\",\"attrs\":{\"line\":{\"targetMarker\":\"\",\"strokeDasharray\":\"\"}},\"connector\":{\"name\":\"pai\"},\"zIndex\":2,\"id\":\"02145525-4340-4513-bcc5-16fab084263f\",\"data\":{\"source\":\"1634278833780\",\"target\":\"1634278784288\",\"outputPortId\":\"1634278833780_out_1\",\"inputPortId\":\"1634278784288edge_table_path\"},\"source\":{\"cell\":\"1634278833780\",\"port\":\"1634278833780_out_1\"},\"target\":{\"cell\":\"1634278784288\",\"port\":\"1634278784288edge_table_path\"}},{\"shape\":\"GuideEdge\",\"attrs\":{\"line\":{\"targetMarker\":\"\",\"strokeDasharray\":\"\"}},\"connector\":{\"name\":\"pai\"},\"zIndex\":2,\"id\":\"f6471ecc-5fc7-4168-952b-e2f0cbeb8caf\",\"data\":{\"source\":\"1634278784288\",\"target\":\"1634279113077\",\"outputPortId\":\"1634278784288cluster_result_path\",\"inputPortId\":\"1634279113077_in_1\"},\"source\":{\"cell\":\"1634278784288\",\"port\":\"1634278784288cluster_result_path\"},\"target\":{\"cell\":\"1634279113077\",\"port\":\"1634279113077_in_1\"}},{\"shape\":\"GuideEdge\",\"attrs\":{\"line\":{\"targetMarker\":\"\",\"strokeDasharray\":\"\"}},\"connector\":{\"name\":\"pai\"},\"zIndex\":2,\"id\":\"e6d521e3-836c-4a3d-929a-c338126a9dff\",\"data\":{\"source\":\"1634525081312\",\"target\":\"1634525299468\",\"outputPortId\":\"1634525081312_out_1\",\"inputPortId\":\"1634525299468label_train_edge\"},\"source\":{\"cell\":\"1634525081312\",\"port\":\"1634525081312_out_1\"},\"target\":